Record request #24-13089 has been closed. The closure reason supplied was:

Dear Requester:

&nbsp;

In regard to items 3 and 4, the Department completed its review and is withholding records responsive to these portions of your request.

&nbsp;

Records were withheld pursuant to Exemption 4 of the Freedom of Information Act, 5 U.S.C. § 552(b)(4) in conjunction with California Government Code Section 7927.705, as the records contain confidential commercial information, the disclosure of which would likely cause substantial competitive harm. Section 7927.705 "does not require disclosure of records, the disclosure of which is exempted or prohibited pursuant to federal or state law".

&nbsp;

Additionally, the requested records are exempt from disclosure under Section 7927.605, whereby "corporate proprietary information including trade secrets" are exempt from disclosure. Therefore, records containing proprietary business information were withheld.

&nbsp;

In regard to items 6 and 7, the Department has completed its review and is providing you with records responsive to these portions of your request.

&nbsp;

If you have any questions, please respond to this email.

&nbsp;

Respectfully,

&nbsp;

LAPD Public Records &amp; Subpoena Response Section, CPRA Unit








