A document has been released for record request #25-1478 along with the following message:

This message is in response to your request to the City of Fremont for public records.&nbsp;Notwithstanding the exemptions stated below, the City has located records that the City believes may be responsive to your request or of interest to you that the City can disclose.&nbsp;Those documents are included with this message.&nbsp;

&nbsp;

To the extent that the requests seek information that is not contained in identifiable records, the Public Records Act does not impose a duty on the City to create a record to respond to your request.&nbsp;Haynie v. Superior Court&nbsp;(2001) 26 Cal.4th 1061, 1075.&nbsp;



To the extent that the request seeks records containing personal information, including identifiable health information, or information that constitutes an unwarranted invasion of a person’s privacy interest, such as credit card information, this information is exempt from disclosure under Government Code §§ 7927.700 and 7923.700.&nbsp;

&nbsp;

To the extent that the requests seek documents containing information gathered as part of an individual criminal investigation case file or intelligence file, these records are exempt from disclosure under Government Code §§ 7923.600 and 7927.705 and Evidence Code §§ 1040(b)(2) and 1041.&nbsp;

&nbsp;

To the extent the requests seek records that are not part of an individual criminal investigation or intelligence file but would reveal the City’s operational/technical strategies, confidential informants, the public interest in not disclosing the information outweighs the public interest in disclosing, since releasing such records to the public would jeopardize public safety, the safety of allied public safety agencies and the ability of the police to safely implement safety and security measures to protect the community.&nbsp;Furthermore, disclosure of this information to the public would allow individuals to defeat or avoid the City’s efforts regarding public and officer safety, property protection, and apprehension of fleeing suspects.&nbsp;As a result, this information is exempt from disclosure under Government § 7922.000 and Evidence Code § 1040(b)(2).&nbsp;

&nbsp;

If there are records you feel should be disclosed notwithstanding this response, or you would like to discuss your requests and this response further, please respond using this portal.



